import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (nav-menu) and click it
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for the mobile menu overlay to appear
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Take screenshot of mobile menu opened
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_opened.png'));

    // Try to find and click a category link inside the mobile menu (e.g., "Electronics")
    // Use XPath to ensure we click the one inside the mobile menu
    const electronicsLinkXPath = "//div[contains(@class,'mobile-menu')]//a[contains(text(),'Electronics')]";
    await page.waitForSelector('#mobileMenuOverlay.show .mobile-menu', { timeout: 5000 });
    const [electronicsLink] = await page.$x(electronicsLinkXPath);

    let clickedCategory = false;
    if (electronicsLink) {
      await electronicsLink.click();
      clickedCategory = true;
    }

    // Take screenshot after clicking category
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_category_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_category_clicked.png'));

    // Close the mobile menu by clicking the close button
    // The close button is inside the mobile menu overlay
    await page.waitForSelector('#mobileMenuOverlay.show .close-mobile-menu', { timeout: 5000 });
    await page.click('#mobileMenuOverlay.show .close-mobile-menu');

    // Wait for the overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'detached', timeout: 5000 });

    // Take screenshot after closing mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    // Extract data: check if mobile menu is hidden and if navigation occurred
    const mobileMenuVisible = await page.$eval('#mobileMenuOverlay', el => el.classList.contains('show')).catch(() => false);

    // Try to extract the current main heading or category shown (if any)
    let currentHeading = '';
    try {
      currentHeading = await page.$eval('h2', el => el.textContent.trim());
    } catch (e) {
      currentHeading = '';
    }

    return {
      success: true,
      action: "Tested mobile menu navigation: opened menu, clicked category, closed menu, verified state.",
      extractedData: {
        mobileMenuVisible,
        clickedCategory,
        currentHeading
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
